  base: *id011
  body: "The following code now causes numba to crash (with the latest version of\
    \ numpy):\r\n\r\n```python\r\nimport numba\r\n\r\n@numba.guvectorize(['float64[:],\
    \ float64[:]'], '(n)->(n)')\r\ndef foo(x, y):\r\n    pass\r\nprint(foo.__doc__)\r\
    \n```\r\n\r\nIt turns out that numba are creating ufuncs with a null doc string.\
    \ It's not clear whether this is legitimate (the documentation doesn't state either\
    \ way as far as I can see), however currently this results in a segfault, and\
    \ this is evidence that at least some people in the community have been doing\
    \ this. This didn't cause any problems until 476ce747b407a18f5c4dea618953b0ea9419fd2b\
    \ where the check for ufunc->doc == NULL was removed.\r\n\r\nThis change restores\
    \ the check, meaning if no doc string in provided then the doc string for the\
    \ ufunc is simply the method signature."
